import React from 'react';
import '../../resources/templates.css'

function Template4() {
  const user= JSON.parse(localStorage.getItem("shaikhresume-user"));
  return (
    <div className='template4-parent'>
      <div className='template-header d-flex flex-column align-items-center'>
        <h1>{user.firstName.toUpperCase()} {user.lastName.toUpperCase()}</h1>
        <p>{user.Email} | {user.mobilenum}</p>
        <p>{user.address}</p>
      </div>

      <div className='divider mt-3'></div>

      <div className='objective mt-3'>
        <h3>Objective</h3>
        <p>{user.objective}</p>
      </div>

      <div className='divider mt-3'></div>

      <div className='education mt-3'>
        <h3>Education</h3>
        {user.Education.map((Education) => (
          <div className='d-flex'>
            <h6><b>{Education.year}:</b></h6>
            <p style={{width:120}}>{Education.Qualification} {Education.Percentage}%</p>
            <p>{Education.Institution}</p>
          </div>
        ))}
      </div>

      <div className='divider mt-3'></div>
      <div className='experience mt-3'>
        <h3>Experience</h3>
        {/* <hr /> */}
        {user.Experience.map((exp) => (
          <div className='d-flex flex-column'>
            <h6><b>{exp.year}:</b></h6>
            <p><b>{exp.Company}</b> in {exp.Place}</p>
          </div>
        ))}
      </div>

      <div className='divider mt-3'></div>
      <div className='projects mt-3'>
        <h3>Projects</h3>
        {/* <hr /> */}
        {user.projects.map((project) => (
          <div className='d-flex flex-column'>
            <h6><b>{project.Title} [{project.year}]:</b></h6>
            <p>{project.description}</p>
          </div>
        ))}
      </div>

      <div className='divider mt-3'></div>
      <div className='skills mt-3'>
        <h3>Skills</h3>
        {/* <hr /> */}
        <ul className='d-flex flex-column'>
          {user.skills.map((skill) => (
            <li>{skill.technology}</li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default Template4;
